description:
The Andrea Tantaros Radio Show MAR-12-2013 TUES














Barbara Walters speaks out about Elizabeth Hasselbeck after US Magazine reported that Hasselbeck,
 the lone conservative on 'The View' was fired. Walters says there are no plans for Hasselbeck to 
leave the show. Will Barbara Walters be the next to leave? Another controversial story in the 
cultural debate on women in the workplace. ALSO, Mayor Bloomberg's Soda Ban has been reversed;
 And is the Obama Administration outsourcing the fight against terrorists? Andrea Tantaros 










